import { useEffect, useState } from "react";
import FontAwesomeIcon from "font-awesome";

const Projects = () => {
  // const iconArr = {Python: , Flask: , React: , Firebase: };
  const [projects, setProjects] = useState([
    {
      name: "Stock Portfolio Web App",
      stack: "Python, Flask, React, Firebase",
      url: "https://pynance.netlify.app/",
    },
  ]);

  useEffect(() => {});
  return (
    <main className="projects">
      <h3>Projects</h3>
      {projects.map((project) => {
        return (
          <section className="project">
            <h3>{project.name}</h3>
            <div className="interactive">
              <iframe src={`${project.url}`} title={`${project.name}`}></iframe>
            </div>
            <div className="tech-stack">
              Tech Stack:
              <FontAwesomeIcon icon="fa-solid fa-flask" />
            </div>
          </section>
        );
      })}
    </main>
  );
};
export default Projects;
